    byPlacement(placement: $placement, bannerCount: $bannerCount) {
      elements {
        id
        callToActionUrl
        placement
        promotedEntityId
        creative {
          imageUrl
          partnerName
          titleText
          bodyText
          callToActionText
          backgroundColor
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
